import React from "react";
import "./styles.css";

const Navbar = () => {
  return (
    <nav>
      <button>所有學生</button>
      <button>新增學生</button>
      <button>刪除學生</button>
      <button>更新資料</button>
    </nav>
  );
};

export default Navbar;
